/**
 * The maximum number of items to return.
 */
export interface GenericPageSize {
    [k: string]: unknown;
}

/**
 * The next_page_token value returned from a previous List request, if any.
 */
export interface GenericPageToken {
    [k: string]: unknown;
}

/**
 * The sorting order for list results.
 */
export interface GenericOrderBy {
    [k: string]: unknown;
}

/**
 * The filter for list results.
 */
export interface GenericFilter {
    [k: string]: unknown;
}

/**
 * The properties returned in the object. By default, all properties are returned.
 */
export interface GenericProperties {
    [k: string]: unknown;
}

/**
 * Object identifier.
 */
export interface GenericId {
    [k: string]: unknown;
}
